import React, { useState } from 'react';
import './ss.css'

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars,faHomeAlt,faRectangleList,faNoteSticky,faUser} from '@fortawesome/free-solid-svg-icons';


import { a } from 'react-router-dom';

const Sidebar = () => {
  const [show, setShow] = useState(false);

  return (
    <div className={show ? 'space-toggle' : null}>
      <header className={`header ${show ? 'space-toggle' : null}`}>
      
        <div className='header-toggle' onClick={() => setShow(!show)}>
        <FontAwesomeIcon icon={faBars} /> 
        </div>
      </header>
      <div className={`sidebar ${show ? 'show' : null}`}>
        <nav className='nav'>
          <div>
          <div className='logo'>
    <img src="./images/logo.png" alt="logo" width={60} />
    </div>
            <a className='nav-logo'>
            <FontAwesomeIcon icon = {faHomeAlt} />
            <p className='nav-logo-name'>Homepage</p>
            </a>
            <div className='nav-list'>
              <a to='/dashboard' className='nav-a active'>
              <FontAwesomeIcon icon={faRectangleList} />
                <p className='nav-a-name'>Summarize</p>
              </a>
              <a to='/hotel' className='nav-a'>
              <FontAwesomeIcon icon={faNoteSticky} />
                <p className='nav-a-name'>Note</p>

              </a>
              <a to='/gallery' className='nav-a'>
              <FontAwesomeIcon icon={faUser} />
                <p className='nav-a-name'>About</p>
              </a>
 
            </div>
          </div>
        </nav>
      </div>
    </div>
  );
};

export default Sidebar;
